import React from "react";
import classes from "./Make.module.css";
const Make = (props) => {
  return (
    <div className={classes.make_parent}>
      {props.items.map((p, i) => {
        return (
          <div key={i}>
            {i + 1}.{p}
          </div>
        );
      })}
    </div>
  );
};
export default Make;
